import React from "react";
import "../App.css";

function List(props) {
    var data = props;

    return (
        <div>
            <table>
                <thead>
                    <th>Name</th>
                    <th>Platform</th>
                    <th>Year</th>
                    <th>Global Sales</th>
                </thead>
                <tbody>
                    {data.map((item) => (
                        <tr>
                            <td>{item.Name}</td>
                            <td>{item.Platform}</td>
                            <td>{item.Year}</td>
                            <td>{item.Global_Sales}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
}

export default List;
